import React from 'react'

function Stagiaire(props) {
    const {stagiaire} = props;
    const {code,nom,prenom,filiere} = stagiaire
  return (
    <tr>
        <td>{code}</td>
        <td>{nom}</td>
        <td>{prenom}</td>
        <td>{filiere}</td>
    </tr>
  )
}

export default Stagiaire
